import React from 'react';

const SideLinks = ({name, Icon}) => {
    return (
        <li className='group'>
            <a href="#" className='block cursor-pointer text-xl mb-3.5 pointer-events-none'>
                <div className='inline-block'>
                    <div className='flex items-center group-hover:bg-dark-content group-hover:text-dark-innerFrame
                      rounded-2xl pl-5 pr-8 py-3'>
                        <Icon/>
                        <span className='ml-4 font-bold'>{name}</span>
                    </div>
                </div>
            </a>
        </li>
    );
};

export default SideLinks;
